import React, { Component } from 'react'
import pic from './11picture.jpg' ;
import {ListGroup, ListGroupItem} from 'reactstrap';

export default class ProductCard extends Component {
    render() {
        return (
            <div>
                <div className="card post bg-dark text-light m-2"
                    title="">
                    <a href="/product/{{_id}}" className="text-decoration-none"
                        title="">
                        <img class="card-img-top" src={pic}
                            alt=""></img>
                        <p class="card-text">Qiyməti:{this.props.price}
                        </p>
                        <span class="text-secondary">Kategoriya: {this.props.category}</span>
                    </a>
                    <hr />
                    <span className="text-secondary rsp" style={{textAlign: 'right'}}></span>
                </div>
            </div>
        )
    }
}
